// components/ResultsList.js
import React from 'react';

const ResultsList = ({ results, noResultsText }) => {
  return (
    <div className="mt-8">
      {results.length === 0 ? (
        <p className="text-center">{noResultsText}</p> 
      ) : (
        <ul>
          {results.map((result, index) => (
            <li key={index} className="mb-4">
              <div className="bg-gray-100 p-4 rounded">
                <h3 className="text-xl font-semibold">{result.doc_id}</h3>
                <p>Score: {result.score}</p>
                <a href={result.file_url} className="text-blue-600 hover:underline">Télécharger le fichier</a>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default ResultsList;
